productionContentData={"saiDaoData":[{"news_source":" 每日经济新闻##东方财富Choice数据、中国半导体行业协会","other_funds":" ","fund_tag":"国产替代风口##周期复苏##AI催化","tag_name":"芯片","index_code":"980017.CNI","news_content":"华为推出“HUAWEI Mate 60 Pro 先锋计划”，在华为商城正式上线。作为中国高端手机市场的领军企业，Mate 60 Pro 发布或将引领国内高端机发展趋势，有望刺激换机需求，<span style=\"color:red\">加速带动智能手机市场复苏，从而刺激半导体产业链回暖。</span>##<span style=\"color:red\">大部分企业在今年上半年持续加大研发投入。</span>150家半导体上市公司研发费用合计290亿元，同比增长13.7%。近八成企业研发费用较去年同期实现不同程度增长。另外，根据中国半导体行业协会数据，预计2023年中国的半导体市场规模将达到1.8万亿元。随着AI先进芯片的需求持续增加，人工智能已成为推动半导体行业增长的重要力量之一。","news_title":" ","lcsy_display_flag":"0","tag_kind":"行业主题","index_name":"国证半导体芯片指数","fund_code":"159995.ETF"},{"news_source":" ","other_funds":" ","fund_tag":"食住行##游乐购##疫后修复","tag_name":"旅游","index_code":"930633.CSI","news_content":"随着社会经济的飞速发展，旅游业成为了经济的重要支柱之一。为了推进旅游业健康发展，各地区都在不断推出相关政策。2023年将执行新一轮旅游业税收优惠政策。包括景区门票税率下调、住宿服务税收减免、旅行社服务费用抵扣、旅游车辆税收优惠等。总之，2023年旅游业税收优惠政策的推出将会对国内旅游业产生积影响。随着政策实施，相信旅游市场将会更深入的繁荣。","news_title":" ","lcsy_display_flag":"1","tag_kind":"行业主题","index_name":" 中证旅游主题指数","fund_code":"159766"},{"news_source":" ##wind，2023.9.5。","other_funds":" ","fund_tag":"能源革命##“指”选南方##估值历史低位","tag_name":"新能源","index_code":"399808.SZ","news_content":"6月23日，财政部、税务总局、工业和信息化部联合发布《关于延续和优化新能源汽车车辆购置税减免政策的公告》:对购置日期在2024年1月1日至2025年12月31日期间的新能源汽车免征车辆购置税其中，每辆新能源乘用车免税额不超过3万元;对购置日期在2026年1月1日至2027年12月31日期间的新能源汽车减半征收车辆购置税，其中，每辆新能源乘用车减税额不超过1.5万元。据财政部，初步估算2024-2027年减免车辆购置税规模总额将达到5200亿元。##9月5日，工业和信息化部、财政部近日联合印发《电子信息制造业2023-2024年稳增长行动方案》。《方案》提出，力争2023年-2024年电力装备行业主营业务收入年均增速达9%以上，工业增加值年均增速9%左右；引导装备制造企业提高供给质量，保障大型风电光伏基地等项目建设。","news_title":"利好事件新能车减征购置税超5千亿","lcsy_display_flag":"1","tag_kind":"行业主题","index_name":"中证新能源指数","fund_code":"516160.ETF"},{"news_source":"有连云##财联社","other_funds":"018031.OF##018032.OF","fund_tag":"高贝塔、高弹性##数字化核心产业高速增长##估值与拥挤度回落","tag_name":"数字经济","index_code":"931582","news_content":"8月29日中午，华为以“先锋计划”方式让Mate60Pro悄然开卖，售价6999元。在技术突破上，华为称Mate60Pro是全球首款在没有地面网络信号的情况下能支持卫星通话的大众智能手机。搭载国产麒麟芯片的HUAWEI Mate 60 Pro有望拉动消费电子需求，并推动半导体材料和零部件的国产化替代进程。##8月31日，百度、字节、商汤、中科院旗下紫东太初、百川智能、智谱华章等8个企业/机构的大模型可正式上线面向公众提供服务。多位业内人士向记者表示，明确生成式AI实施算法的“备案制”，而不是此前预期的审核许可制，总体体现了意在促进人工智能产业发展创新的“呵护式”监管思路。","news_title":"哪些最新消息在影响走势？","lcsy_display_flag":"1","tag_kind":"行业主题","index_name":"中证数字经济主题指数","fund_code":"159658"},{"news_source":"证券时报,2024/10/30","other_funds":" 159919.ETF#SZACCOUNT##159977.ETF#SZACCOUNT","fund_tag":"核心资产##龙头##大盘宽基","tag_name":"中证A50","index_code":"930050.CSI","news_content":"在回购增持再贷款新政落地后，沪市公司积极响应，陆续发布回购增持专项贷款公告。证券时报记者统计发现，截至10月29日，沪市已有30家公司披露利用专项贷款进行回购增持公告32份，其中主板公司24家26份，科创板公司6家6份。在32份公告中，回购公告20份，贷款总额34.62亿元；增持公告12份，贷款总额48.9亿元，可见，沪市公司回购增持专项贷款规模已达83.52亿元。","news_title":" 逾80亿元！沪市已有30家公司披露回购增持专项贷款公告","lcsy_display_flag":"0","tag_kind":"核心宽基","index_name":"中证A50指数","fund_code":"563350.ETF#SHACCOUNT"},{"news_source":" ","other_funds":" ","fund_tag":"顺周期##政策市##估值性价比高","tag_name":"沪深300","index_code":"000300","news_content":"8月27日出台了一系列活跃资本市场举措，包括1）财政部宣布印花税减半；2）证监会明确阶段性收紧IPO和再融资，纾困房地产；3）破发破净或近三年累计分红少于年均利润30%的公司，控股股东不得减持；4）融资保证金最低比例降至80%。一揽子活跃资本市场的举措体现出政府对于资本市场非常重视，能够让广大投资者更直接地感受到政策的积极信号，同时让市场从过去的过度悲观预期中走出来，向积极的方向修正。","news_title":" ","lcsy_display_flag":"0","tag_kind":"核心宽基","index_name":"沪深300指数","fund_code":"159919.ETF"},{"news_source":"财联社##财联社","other_funds":" ","fund_tag":"高成长性##高新技术##政策红利","tag_name":"创业板","index_code":"399006","news_content":"8月30日中国人民银行举行金融支持民营企业发展工作推进会。在会议上央行、证监会、金融监管总局等多部门重磅发声，表示下一步将引导金融资源更多地流向民营企业和小微企业，持续提高民企贷款占比。同时支持上市房企在资本市场融资，保持房企股债融资渠道稳定，支持正常经营房企合理融资需求。##8月27日，财政部及税务总局联合发布《关于减半征收证券交易印花税的公告》，为活跃资本市场、提振投资者信心，自2023年8月28日起，证券交易印花税实施减半征收。","news_title":"经济活跃度提升，成长赛道景气度提升","lcsy_display_flag":"0","tag_kind":"核心宽基","index_name":" ","fund_code":"159977.ETF"},{"news_source":"新京报##中国新闻网##21世纪经济报","other_funds":" ","fund_tag":"中小盘##成长风格##专精特新含量高","tag_name":"中证2000","index_code":"399303","news_content":"8月30日，金融支持民营企业发展工作推进会召开。会上，央行党委书记、行长潘功胜表示，在货币政策方面，央行将在未来保持总体流动性合理充裕。同时在结构性的货币政策和信贷政策上，将引导金融资源更多地流向民营企业和小微企业。##财政部网站8月25日发布《关于加强财税支持政策落实 促进中小企业高质量发展的通知》。通知要求，各地区要加大工作力度，不折不扣落实支持中小企业发展的各项财税政策，为推动中小企业高质量发展提供有力保障。##半年报披露已基本结束，上半年商业银行持续加大对实体经济的支持力度，上半年六大行贷款主要聚焦普惠小微贷款、绿色贷款、制造业贷款、战略性新兴产业贷款等领域，增速普遍高于整体贷款增速。","news_title":" ","lcsy_display_flag":"0","tag_kind":"核心宽基","index_name":" ","fund_code":"159521"}]}
